import collections

class Solution(object):
    def find_positive_subarray(self, arr, avg, k):

        max_sum = collections.defaultdict(int)

        for idx in range(len(arr)):
            if idx == 0:
                max_sum[idx] = arr[idx] - avg
            else:
                max_sum[idx] = max(arr[idx] - avg, max_sum[idx - 1] + arr[idx] - avg)

        start, end = 0, k-1

        curr_sum = 0
        for idx in range(start, end + 1):
            curr_sum += arr[idx] - avg

        if curr_sum > 0:
            return curr_sum

        result = curr_sum

        while end < len(arr)-1:
            curr_sum = curr_sum - arr[start] + arr[end + 1]

            if curr_sum > 0:
                return curr_sum

            result = max(result, curr_sum)

            result = max(result, curr_sum + max_sum[start])

            start += 1
            end += 1

        return result


    def findMaxAverage(self, nums, k):
        min_val, max_val = float("Inf"), -float("Inf")

        for num in nums:
            min_val = min(min_val, num)
            max_val = max(max_val, num)

        left, right = min_val, max_val

        out_avg = left

        while abs(right - left) > 0.000001:
            out_avg = (left + right) / float(2.0)

            q = self.find_positive_subarray(nums, out_avg, k)

            if q < 0:
                right = out_avg
            else:
                left = out_avg

        return out_avg


